Автомобиль выставлен на продажу группой компаний «К-Моторс»: 
- прошел комплексную диагностику и предпродажную подготовку;
- прошел проверку на юридическую чистоту; 
- имеется полный пакет документов. 

Способы оплаты:

- наличный расчет;
- безналичный платеж; 
- прием Вашего автомобиля по рыночной стоимости в рамках программы Трейд-Ин. Погашение остатка кредита за него (при необходимости);
- покупка в кредит: специальные предложения по кредитованию и страхованию;
- оформление кредита по двум документам.


Группа компаний «К-Моторс» – официальный дилер BMW, Skoda, Hyundai, Nissan и Haval в Петрозаводске. Автомобильный парк нашей компании насчитывает более 150 автомобилей c пробегом в наличии!
